import logo from './logo.svg';
import './App.css';

function Test(props) {
  return (
    <p>{props.name}</p>,
    <p>{props.age}</p>
  );
}

function App() {
  return (
    <p>Head: </p>,
    <Test name="Ray" age="22" />
  );
}

export default App;
